import React, { Component } from 'react';
import { Redirect } from 'react-router';

export default class Login extends Component {
  constructor() {
    super();
    this.state = {
      loginComplete: false,
    }
  }


  handleClick = () => {
    return (<Redirect to="/" />);
  };

  render() {
    const { loginComplete } = this.state;
    return (
      <div>
        <input type="email" />
        <input type="password" />
        <button type="button" onClick={() => this.handleClick() }>Login</button>

      </div>
    )
  }
}
